import {StyleSheet,View,Text,TextInput} from 'react-native'

class AuthScene extends Component{
render(){

    return (
    <View>
        <Text style={styles.welcome}>Login To The Application</Text>
        <TextInput
        style={styles.input} 
placeholder="Numéro de téléphone"       
        />
         <TextInput
        style={styles.input} 
placeholder="Mot de passe"       
        />

    </View>

    );
}



};

export default AuthScene;

const styles=StyleSheet.create({
    container:{
        flex:1,
        justifyContent:'center',
        alignItems:'center',
    
    
    },
    welcome:{
        fontSize:30,
        textAlign:'center',
        fontFamily:'Roboto-Thinltalic',
        margin:10,
        },
    input:{
width:"90%",
backgroundColor:"#fff",
padding: 15,
marginBottom: 10,
